  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:03.143131\",\n\t\"name\": \"big-oaks-national-wildlife-refuge-interim-public-access-plan-2000\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This interim plan covers public access
  for Big Oaks National Wildlife Refuge. Sections include introduction, safety briefing
  protocols, entry procedure, types of public use, access, protocols on how public
  use will be monitored, limited, and controlled, key control, and use of Refuge by
  Old Timbers Lodge guests. Furthermore, a plan covering Jefferson Range access. Topics
  include range personnel, visitors, contractors, gate, fence, barricades, key control,
  safety signs, safety brief, communications, weapons safety footprint, emergency
  response, aircraft accident, fire response, law enforcement response, and Old Timbers
  Lodge. Additionally unexploded ordnance (UXO) response standing operating procedure
  is covered. These plans were developed to allow the Army to review and approve safety
  procedures prior to public use occurring on the refuge.\",\n\t\"license_title\":
